import React from 'react';

const Home = () => {
    return (
        <div>
            <img className="ui fluid image" src="/early_morning.jpg" />
            <div className="ui horizontal list">
                <div className="item">
                    <div className="content">
                        <div className="ui sub header">

                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
